    "description": "Gaga/people classes are open to people ages 16+, regardless of their background in dance or movement. No previous dance experience is needed.Gaga/people classes last for one hour and are taught by dancers who have worked closely with Ohad Naharin. Teachers guide the participants using a series of evocative instructions that build one on top of the other. Rather than copying a particular movement, each participant in the class actively explores these instructions, discovering how he or she can interpret the information and perform the task at hand. Gaga/people classes offer a creative framework for participants to connect to their bodies and imaginations, increase their physical awareness, improve their flexibility and stamina, and experience the pleasure of movement in a welcoming, accepting atmosphere.Participants should wear comfortable clothes and be prepared to dance barefoot or in socks. It is advisable to bring a bottle of water and a towel for use after class.IMPORTANT NOTE: Late entry is not permitted in Gaga classes. The first few minutes of Gaga is very important due to the physical and mental awareness it creates for the class environment. Please plan accordingly.",
